    position: fixed;
    top: 40px;
    right: -700px;
    width: 530px;
    height: 868px;
    background-color: #fff;
    box-sizing: border-box;
    box-shadow: 2px 2px 2px 2px #999;
    z-index: 999;

    .cart_pop_inner {
        width: 500px;
        height: 835px;
        margin: 0 auto;
        margin-top: 15px;
        background-color: initial;
        border: 1px solid #222;
        text-align: center;

        >p {
            margin-top: 250px;
            font-family: $font-family;
        }

        >div {
            display: flex;
            justify-content: center;

            &:nth-child(2) {
                margin-top: 70px;

                >div {
                    &:nth-child(1) {
                        width: 110px;
                        height: 180px;
                        overflow: hidden;

                        >img {
                            width: 180%;
                            transform: translate(-23%, -7%);
                        }
                    }

                    &:nth-child(2) {
                        margin-left: 20px;
                        padding-top: 60px;
                        box-sizing: border-box;

                        >p {
                            margin-top: 5px;
                            font-size: 14px;
                            font-family: $font-family;
                        }

                        >h5 {
                            &:nth-child(3) {
                                margin-top: 20px;
                            }
                        }
                    }
                }

            }

            &:nth-child(3) {
                display: flex;
                justify-content: space-between;
