            &:nth-child(4) {
                margin-top: 60px;
                border: 1px solid #222;
            }

            &:nth-child(5) {
                margin-top: 10px;
                background-color: #222;
                color: #fff;
            }

            &:nth-child(6) {
                position: absolute;
                width: 50px;
                height: 50px;
                top: 30px;
                right: 30px;
                font-size: 25px;

                &:hover {
                    color: #999;
                }
            }
        }
    }
}























/********************** instar_swiper ********************/


.insta_tit {
    font-size: 30px;
    margin-bottom: 20px;
}

.contents05 {
    width: 1300px;
    height: 280px;
    background-color: $color;

    .instar {
        width: 100%;
        height: 100%;

        .swiper-wrapper {
            position: relative;

            .swiper-slide {
                width: 280px;
                height: 280px;
                text-align: center;
                font-size: 18px;
                background-color: #ddd;
                display: flex;
                justify-content: center;
                align-items: center;
                /* overflow: hidden; */
                cursor: pointer;

                &:hover>img {
                    transform: translateY(-5px);
                }

                &:hover .insta_txt {
                    bottom: 0;
                }

                .shopping_icon {
                    position: absolute;
                    top: 10px;
                    right: 10px;
                    width: 30px;
                    height: 30px;
                    background-color: #000;
                    border-radius: 50%;

                    &:hover {
                        background-color: #fff;

                        img {
                            filter: invert(100%);
                        }
                    }

                    img {
                        width: 100%;
                    }
                }

                >img {
                    display: block;
                    width: 100%;
                    height: 100%;
                    object-fit: cover;
                    transition: 0.3s;
                }

                .insta_txt {
                    position: absolute;
                    width: 250px;
                    height: 70px;
                    bottom: -70px;
                    transition: 0.3s;

                    .insta_txt_bg {
                        position: absolute;
                        top: 0;
                        background-color: #222;
                        opacity: 0.5;
                        width: 250px;
                        height: 70px;
                        border-radius: 30px 30px 0 0;
                    }

                    .insta_id {
                        position: absolute;
                        left: 50%;
                        transform: translateX(-50%);
                        margin-top: 15px;
                        color: #fff;
                        position: absolute;
                        letter-spacing: 1px;
                        font-size: 14px;
                    }

                    .insta_text {
                        position: absolute;
                        margin-top: 40px;
                        left: 50%;
                        transform: translateX(-50%);
                        color: #fff;
                        font-size: 12px;
                        width: 200px;
                        overflow: hidden;
                        font-family: $font-family;
                        text-overflow: ellipsis;
                        white-space: nowrap;
                    }
                }
            }
        }

        .next_button {
            .next_back {
                position: absolute;
                top: 0;
                right: 0;
                z-index: 1;
                width: 80px;
                height: 100%;
                background-color: #fff;
                opacity: 0.5;
            }

            .swiper-button-next {
                margin-right: 10px;
                color: #222;
            }
        }

        .prev_button {
            .prev_back {
                position: absolute;
                top: 0;
                left: 0;
                z-index: 1;
                width: 80px;
                height: 100%;
                background-color: #fff;
                opacity: 0.5;
            }

            .swiper-button-prev {
                margin-left: 10px;
                color: #222;
            }
        }
    }

}


/***** insta_pop *******/
.insta_ex {
    /* display: none; */

    /*  width: 100vw; height: 100vh;
background-color: #fff; */
    .insta_page {
        position: fixed;
        top: 10%;
